import React from "react";
import {
  ComposableMap,
  Geographies,
  Geography
} from "react-simple-maps";

const geoUrl =
  "https://raw.githubusercontent.com/zcreativelabs/react-simple-maps/master/topojson-maps/world-110m.json";

const MapChart = () => {
  return (
      <ComposableMap>
          <Geographies geography={geoUrl}>
            {({geographies}) => 
                geographies.map(geo => (
                    <Geography 
                        key={geo.rsmKey} 
                        geography={geo}
                        fill="#DDD"
                        stroke="#FFF" 
                    />
                ))
            }
          </Geographies>
      </ComposableMap>
  );
};

export default MapChart;
